import React from 'react'

export default function PedidoItem({ cantidad, nombre, precio }) {
	return (
		<>
			<div>
				<p>{cantidad} x {nombre}</p>
			</div>
			<div className="filler"></div>
			<div>
				$ {precio}
			</div>
		</>
	)
}
